import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import Home from '../src/pages/Home'

function App() {



  return (
    <div className='App'>
        <Router>
          <Switch>
            <Route path='/' exact Component={Home}>
            </Route>
          </Switch>
        </Router>

    </div>
  );
}

export default App;
